	/* START-USER-CODE */

	// Write your code here
	playerVelocity = 300;
	playerJumpPower = 0;
	jumpDirection = 0;
	isJumping = false;
	private iceAcceleration = 800;
	private iceFriction = 400;
	checkpointsReached = 0;
	private collectedCheckpoints = new Set<string>();
	lastTelemetry = 0;
	private sessionDuration = 24 * 60 * 60 * 1000; //24 hours
	create() {
		this.editorCreate();
		this.collisionLayer.setCollision([11]);
		this.iceLayer.setCollision([1]);

		this.checkpointLayer.setTileIndexCallback(56, (_sprite: any, tile: Phaser.Tilemaps.Tile) => {
			const key = `${tile.x},${tile.y}`;
			if (this.collectedCheckpoints.has(key)) return;
			this.collectedCheckpoints.add(key);
			tile.setAlpha(0);
			this.checkpointsReached++;
		}, this);

		this.finishLayer.setTileIndexCallback(130, (_sprite: any, tile: Phaser.Tilemaps.Tile) => {
			const key = `${tile.x},${tile.y}`;
			if (this.collectedCheckpoints.has(key)) return;
			this.collectedCheckpoints.add(key);
			tile.setAlpha(0);
			this.scene.start("Finish");
		}, this);

		this.settings.setScrollFactor(0);
		this.settings.setPosition(1200, 80);
		this.physics.world.setBounds(0, 0, 1280, 7000);
		this.physics.world.TILE_BIAS = 40;
		this.sessionId = this.getOrCreateSession();
		this.arcadesprite_1.setBounce(0.7, 0);

		this.input.keyboard!.on('keydown-ESC', () => {
			this.scene.pause();
			this.scene.launch('Pause');
		});

		this.settings.setInteractive({ useHandCursor: true });
		this.settings.on("pointerdown", () => {
			this.scene.pause();
			this.scene.launch('Pause');
		});
	}

	update(_time: number, delta: number) {

		//debugging
		//console.log(this.checkpointsReached);
		//console.log();

		//Camera Follow
		this.cameras.main.startFollow(this.arcadesprite_1, true);
		//this.cameras.main.setFollowOffset(0, 1000);
		this.cameras.main.setBounds(0, 0, 1280, 7000);

		const body = this.arcadesprite_1.body!;
		const onGround = body.blocked.down;
		const isMovingUp = body.velocity.y < 0;

		// Check if any part of the player's feet is on an ice tile
		const feetY = body.y + body.height + 1;
		const feetLeft = body.x;
		const feetCenter = body.x + body.halfWidth;
		const feetRight = body.x + body.width;
		const iceTileLeft = this.iceLayer.getTileAtWorldXY(feetLeft, feetY);
		const iceTileCenter = this.iceLayer.getTileAtWorldXY(feetCenter, feetY);
		const iceTileRight = this.iceLayer.getTileAtWorldXY(feetRight, feetY);
		const isIce = (t: typeof iceTileLeft) => t != null && t.index === 1;
		const isOnIce = onGround && (isIce(iceTileLeft) || isIce(iceTileCenter) || isIce(iceTileRight));

		if (body.velocity.x > 0 && !onGround) {
			this.arcadesprite_1.flipX = false;
		} else if (body.velocity.x < 0 && !onGround) {
			this.arcadesprite_1.flipX = true;
		}

		if (onGround && !isMovingUp) {
			if (this.spaceKey.isDown) {
				this.arcadesprite_1.setVelocityX(0);
				this.arcadesprite_1.play("CharacterChargespritesheet", true);

				this.playerJumpPower = Phaser.Math.Clamp(this.playerJumpPower + 10, 0, 1200);

				if (this.leftKey.isDown) {
					this.jumpDirection = -1;
				} else if (this.rightKey.isDown) {
					this.jumpDirection = 1;
				} else {
					this.jumpDirection = 0;
				}

				if (this.playerJumpPower === 1200) {
					this.applyJump();
				}
			} else {

				if (Phaser.Input.Keyboard.JustUp(this.spaceKey)) {
					this.applyJump();
				} else {
					//normal walking
					if (isOnIce) {
						const dt = delta / 1000;
						// Always apply ice friction first
						if (body.velocity.x > 0) {
							body.velocity.x = Math.max(body.velocity.x - this.iceFriction * dt, 0);
						} else if (body.velocity.x < 0) {
							body.velocity.x = Math.min(body.velocity.x + this.iceFriction * dt, 0);
						}
						// Then apply acceleration from input
						if (this.leftKey.isDown) {
							this.arcadesprite_1.play("characterWalkspritesheet", true);
							body.velocity.x = Math.max(body.velocity.x - this.iceAcceleration * dt, -this.playerVelocity);
							this.arcadesprite_1.flipX = true;
						} else if (this.rightKey.isDown) {
							this.arcadesprite_1.play("characterWalkspritesheet", true);
							body.velocity.x = Math.min(body.velocity.x + this.iceAcceleration * dt, this.playerVelocity);
							this.arcadesprite_1.flipX = false;
						} else {
							this.arcadesprite_1.play("CharacterFrontspritesheet", true);
						}
					} else {
						if (this.leftKey.isDown) {
							this.arcadesprite_1.play("characterWalkspritesheet", true);
							this.arcadesprite_1.setVelocityX(-this.playerVelocity);
							this.arcadesprite_1.flipX = true;
						} else if (this.rightKey.isDown) {
							this.arcadesprite_1.play("characterWalkspritesheet", true);
							this.arcadesprite_1.setVelocityX(this.playerVelocity);
							this.arcadesprite_1.flipX = false;
						} else {
							this.arcadesprite_1.play("CharacterFrontspritesheet", true);
							this.arcadesprite_1.setVelocityX(0);
						}
					}
				}
			}
		}

		this.updateTelemetry(_time);
	}

	private applyJump() {
		this.arcadesprite_1.setVelocityY(-this.playerJumpPower);
		this.arcadesprite_1.setVelocityX(this.jumpDirection * this.playerVelocity * 1.5);
		this.arcadesprite_1.play("CharacterJumpspritesheet", true);

		this.playerJumpPower = 0;
		this.jumpDirection = 0;
	}

	private getOrCreateSession() {
		const stored = localStorage.getItem('gameSession');

		if (stored) {
			const session = JSON.parse(stored);
			const now = Date.now();

			//if expired create new session
			if (now - session.created < this.sessionDuration) {
				console.log('Existing session:', session.id);
				return session.id;
			} else {
				console.log('Session expired, creating new one');
			}
		}

		//new session
		const newSessionId = Date.now() + '-' + Math.random().toString(36).substr(2, 9);
		localStorage.setItem('gameSession', JSON.stringify({
			id: newSessionId,
			created: Date.now()
		}));
		console.log('New session created:', newSessionId);
		return newSessionId;
	}
	sessionId = '';

